window.bookSummaryJSON = "<p><b>Don't Miss the Original Series </b><b><i>Tom Clancy's Jack Ryan</i></b><b> Starring John Krasinski!</b></p> <p><b>The #1 </b><b><i>New York Times</i></b><b> bestseller that launched the phenomenal career of Tom Clancy - a gripping military thriller that introduced the world to his unforgettable hero, Jack Ryan - nominated as one of America’s best-loved novels by PBS’s </b><b><i>The Great American Read</i></b><b>.</b></p> <p>Somewhere under the freezing Atlantic, a Soviet sub commander has just made a fateful decision. The <i>Red October</i> is heading west. The Americans want her. The Russians want her back. The chase for the highly advanced nuclear submarine is on - and there’s only one man who can find her...</p> <p>Brilliant CIA analyst Jack Ryan has little interest in fieldwork, but when covert photographs of <i>Red October</i> land on his desk, Ryan soon finds himself in the middle of a high-stakes game of hide-and-seek played by two world powers - a game that could end in all-out war.</p>"; 
